import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/ThreePL.css";

const heroSlides = [
  {
    title: "RGM Logistics",
    subtitle: "Reliable ‚Ä¢ Transparent ‚Ä¢ Family-Driven Third-Party Logistics",
  },
  {
    title: "Flatbed Logistics Experts",
    subtitle: "Precision, safety, and communication on every load",
  },
  {
    title: "Your Trusted 3PL Partner",
    subtitle: "Built on relationships, not transactions",
  },
];

function ThreePL() {
  const [currentSlide, setCurrentSlide] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prev) => (prev + 1) % heroSlides.length);
    }, 4500);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="rgm-3pl-page">

      {/* HERO SLIDESHOW */}
      <section className="rgm-3pl-hero">
        <div className="rgm-3pl-hero-overlay" />

        <div className="rgm-3pl-hero-content">
          <h1 key={heroSlides[currentSlide].title}>
            {heroSlides[currentSlide].title}
          </h1>
          <p key={heroSlides[currentSlide].subtitle}>
            {heroSlides[currentSlide].subtitle}
          </p>
        </div>
      </section>

      {/* INTRO */}
      <section className="rgm-3pl-intro fade-section">
        <blockquote>
          ‚ÄúEven at the last minute, we can rely on RGM to find the right solution.
          Communication is clear, honest, and dependable ‚Äî it truly feels like
          working with a partner, not just a provider.‚Äù
          <span>‚Äî RGM Logistics Partner</span>
        </blockquote>
      </section>

      {/* WHY */}
      <section className="rgm-3pl-why fade-section">
        <h2>Why Work With a Third-Party Logistics Provider?</h2>
        <p>
          Transportation is critical to your business ‚Äî but managing it doesn‚Äôt
          have to be your burden. By partnering with <strong>RGM Logistics</strong>,
          you gain access to flatbed-focused logistics expertise, trusted carrier
          relationships, and smart solutions ‚Äî while staying focused on growing
          your business.
        </p>
      </section>

      {/* ADVANTAGES */}
      <section className="rgm-3pl-advantages">
        {[
          ["üöõ Flatbed Logistics Expertise", "Exclusive flatbed focus ensures precision, safety, and real-world expertise."],
          ["üí∞ Smarter Flatbed Pricing", "Optimized routes, trusted carriers, transparent pricing."],
          ["üéØ Specialized Freight Focus", "Construction, steel, machinery, oversized flatbed loads."],
          ["‚≠ê Reliable Delivery Experience", "Clear communication and dependable execution."],
        ].map(([title, desc], index) => (
          <div className="adv-card fade-section" key={index}>
            <h3>{title}</h3>
            <p>{desc}</p>
          </div>
        ))}
      </section>

      {/* SERVICES */}
      <section className="rgm-3pl-services fade-section">
        <h2>Our Flatbed 3PL Services</h2>
        <p className="services-subtext">
          RGM Logistics delivers strength, safety, and precision on every flatbed load.
        </p>

        <div className="service-grid">
          <span>Flatbed Truckload (FTL)</span>
          <span>Construction Materials</span>
          <span>Steel & Metal Freight</span>
          <span>Machinery & Equipment</span>
          <span>Oversized & Specialized Loads</span>
          <span>Project-Based Shipping</span>
        </div>
      </section>

      {/* CTA */}
      <section className="rgm-3pl-cta">
        <div className="rgm-3pl-cta-content fade-section">
          <h2>Let‚Äôs Move Your Flatbed Freight Forward</h2>
          <p>
            Flatbed logistics solutions built on trust, communication, and family values.
          </p>

          <div className="cta-buttons">
            <Link to="/contact" className="cta-primary">
              Get A Quote
            </Link>
            <Link to="/contact" className="cta-secondary">
              Click to Call
            </Link>
          </div>
        </div>
      </section>

    </div>
  );
}

export default ThreePL;
